import React from "react";
import "./Authentication.css";
import Form from "../Form/Form";
import validations from "../../Validations/Validations";
export default function Authentication(props) {
  return (
    <div className="auth_container">
      <Form
        formLogo={
          <img
            className="authentication_logo"
            src="https://calcalistcareebiz.s3.eu-central-1.amazonaws.com/6288/2/6288636806425463443521_26.jpg"
          />
        }
        fields={{ email: "", first_name: "", last_name: "" }}
        elements={[
          {
            id: "first_name",
            type: "input",
            title: "First Name",
            placeholder: "first name",
            customClass: "first_name",
            validate: (v) => validations.first_name(v.toString().toLowerCase()),
            errorMsg: "First name has to be above 2 letters",
          },

          {
            id: "last_name",
            type: "input",
            title: "Last Name",
            placeholder: "last name",
            customClass: "last_name",
            validate: (v) => validations.last_name(v.toString().toLowerCase()),
            errorMsg: "First name has to be above 2 letters",
          },
          {
            id: "email",
            type: "input",
            title: "Email",
            placeholder: "Email",
            customClass: "email",
            validate: (v) => validations.email(v.toString().toLowerCase()),
            errorMsg: "First name has to be above 2 letters",
          },
        ]}
      />
    </div>
  );
}
